import React from 'react';
import DatePicker from "react-datepicker";

export default function MembersActive(props){

    return(
        <section>
            <h3>{props.name}</h3>
            <p>{props.id}</p>
            <p>{props.index}</p>
            <p>Active Duration:</p>
            { 
                props.period.map((members,index) =>{
                    return(
                        <span key={index}>
                            <div>Start Time:{members.start_time}</div>
                            <div>End Time:{members.end_time}</div>
                        </span>
                    );
                })
            } 
            <div>
                <div>From:</div>
                    <DatePicker
                        selected={new Date()}
                        inline
                        placeholderText="Click to select Date"
                        onChange={date => setStartDate(date)}
                        peekNextMonth
                        showMonthDropdown
                        showYearDropdown
                        dropdownMode="select"
                        className="col-20"
                    />
            </div>
            <button onClick={props.togglePopup}>CLOSE</button>
        </section>
    );
}
